INSERT INTO `wp_posts` VALUES("300", "3", "2017-02-01 14:37:03", "2017-02-01 14:37:03", "En hier komt jouw tekst te staan! Het is namelijk van groot belang om je website te voorzien van goede content. Je wilt je bezoekers immers overtuigen, aan het denken zetten of aanzetten tot een bepaalde actie. Zonder een pakkende en aantrekkelijke tekst is dat bijna onmogelijk.\r\n\r\nWat we dus van jou verwachten is een tekst voor deze pagina, het liefst met een aanvaardbare lengte (neem als minimumlengte 150 woorden). Dit is namelijk niet alleen voor de informatievoorziening belangrijk; ook Google waardeert je website beter als je gebruik maakt van goede teksten. Deze tekst ontvangen we graag  eventueel samen met de andere nog ontbrekende teksten  in een Word-document, waarbij je duidelijk aangeeft voor welke pagina(s) de tekst(en) bedoeld is/zijn.\r\n\r\nWellicht vind je het lastig om zelf teksten te schrijven of heb je er simpelweg de tijd niet voor. Bij Best4u begrijpen we dat. Daarom hebben wij een contentstrateeg in dienst die jou kan helpen bij het schrijven van de juiste teksten voor je website. Heb je hier interesse in? Neem dan <a href=\"http://luximobil.md/contact/\">contact</a> met ons op voor het ontvangen van een offerte.", "Disclaimer", "", "inherit", "closed", "closed", "", "192-revision-v1", "", "", "2017-02-01 14:37:03", "2017-02-01 14:37:03", "", "192", "http://luximobil.md/192-revision-v1/", "0", "revision", "", "0");
