INSERT INTO `wp_wfissues` VALUES("36", "1446016693", "new", "dnsChange", "2", "c1f94b58f4b921454888faa55438db84", "c1f94b58f4b921454888faa55438db84", "Your DNS records have changed", "We have detected a change in the A records of your DNS configuration that may affect the domain localhost:81. An A record is a record in DNS that points a domain name to an IP address. A change in your DNS records may indicate that a hacker has hacked into your DNS administration system and has pointed your email or website to their own server for malicious purposes. It could also indicate that your domain has expired. If you made this change yourself you can mark it \'resolved\' and safely ignore it.", "a:4:{s:4:\"type\";s:1:\"A\";s:4:\"host\";s:12:\"localhost:81\";s:6:\"oldDNS\";s:42:\"ginformations.tk points to 216.218.192.170\";s:6:\"newDNS\";s:0:\"\";}");
